import React from 'react';
import './HomePage.css';

const HomePage = () => {
  return (
    <div className="home">
      <div className="hero">
        <h1>Welcome to Dubai Project</h1>
        <p>Enhancing Marketing and Cooperation in Dubai</p>
      </div>
    </div>
  );
};

export default HomePage;
